INSERT INTO public.book (id, number_of_copies, author, description, genre, image, title, year_of_publication) VALUES (355, 50, 'Cherie Priest', 'In the early days of the Civil War, rumors of gold in the frozen Klondike brought hordes of newcomers to the Pacific Northwest. Anxious to compete, Russian prospectors commissioned inventor Leviticus Blue to create a great machine that could mine through Alaska’s ice. Thus was Dr. Blue’s Incredible Bone-Shaking Drill Engine born.

But on its first test run the Boneshaker went terribly awry, destroying several blocks of downtown Seattle and unearthing a subterranean vein of blight gas that turned anyone who breathed it into the living dead.', 'Steampunk, Fantasy, Science, Fiction, Fiction', E'\\', 'Boneshaker', '2009-06-01');
INSERT INTO public.book (id, number_of_copies, author, description, genre, image, title, year_of_publication) VALUES (404, 10, 'Jennifer L. Armentrout', 'Long ago, the world was destroyed by gods. Only nine cities were spared. Separated by vast wilderness teeming with monsters and unimaginable dangers, each city is now ruled by a guardian―royalty who feed on mortal pleasure.

Born with an intuition that never fails, Calista knows her talents are of great value to the power-hungry of the world, so she lives hidden as a courtesan of the Baron of Archwood. In exchange for his protection, she grants him information.

When her intuition leads her to save a traveling prince in dire trouble, the voice inside her blazes with warning―and promise. Today he’ll bring her joy. One day he''ll be her doom.

When the Baron takes an interest in the traveling prince and the prince takes an interest in Calista, she becomes the prince’s temporary companion. But the city simmers with rebellion, and with knights and monsters at her city gates and a hungry prince in her bed, intuition may not be enough to keep her safe.

Calista must follow her intuition to safety or follow her heart to her downfall.', 'Fantasy, Romance, Fantasy Romance, Adult, Fiction, New Adult, Paranormal', E'\\', 'Fall of Ruin and Wrath', '2023-09-12');
INSERT INTO public.book (id, number_of_copies, author, description, genre, image, title, year_of_publication) VALUES (403, 250, 'John Scalzi', 'Inheriting your uncle''s supervillain business is more complicated than you might think. Particularly when you discover who''s running the place.

Charlie''s life is going nowhere fast. A divorced substitute teacher living with his cat in a house his siblings want to sell, all he wants is to open a pub downtown, if only the bank will approve his loan.

Then his long-lost uncle Jake dies and leaves his supervillain business (complete with island volcano lair) to Charlie.

But becoming a supervillain isn''t all giant laser death rays and lava pits. Jake had enemies, and now they''re coming after Charlie. His uncle might have been a stand-up, old-fashioned kind of villain, but these are the real thing: rich, soulless predators backed by multinational corporations and venture capital.

It''s up to Charlie to win the war his uncle started against a league of supervillains. But with unionized dolphins, hyperintelligent talking spy cats, and a terrifying henchperson at his side, going bad is starting to look pretty good.

In a dog-eat-dog world...be a cat.', 'Science Fiction, Fiction, Fantasy, Humor, Adult, Audiobook, Science Fiction Fantasy', E'\\', 'Starter Villain', '2023-09-19');
INSERT INTO public.book (id, number_of_copies, author, description, genre, image, title, year_of_publication) VALUES (405, 253, 'Erin Hunter', 'In this Super Edition, discover the origins of the first leader of RiverClan—a mysterious cat whose desire for peace would help shape the dawn of the warrior Clans.

When a storm-tossed river sweeps Ripple away from the park he’s always known, he commits himself to the life of a peaceful loner. Still, as his new island home starts to become a sanctuary for other rogues, he can’t help but feel responsible for their safety, and for the community—and Clan—they are beginning to build. But when an old friend from the park resurfaces with terrible news just as the forest cats’ fights begin to escalate into bloodshed, the cat now known as Riverstar will have to decide which home he is truly committed to protecting: his new Clan or his old family.', 'Fantasy, Animals, Middle Grade', E'\\', 'Riverstar''s Home', '2023-09-05');
INSERT INTO public.book (id, number_of_copies, author, description, genre, image, title, year_of_publication) VALUES (402, 26, 'Ava Reid', 'Effy Sayre has always believed in fairy tales. She’s had no choice. Since childhood, she’s been haunted by visions of the Fairy King. She’s found solace only in the pages of Angharad - author Emrys Myrddin’s beloved epic about a mortal girl who falls in love with the Fairy King, and then destroys him.

Effy’s tattered, dog-eared copy is all that’s keeping her afloat through her stifling first term at Llyr’s prestigious architecture college. So when Myrddin’s family announces a contest to design the late author’s house, Effy feels certain this is her destiny.

But Hiraeth Manor is an impossible task: a musty, decrepit estate on the brink of crumbling into a hungry sea. And when Effy arrives, she finds she isn’t the only one who’s made a temporary home there. Preston Héloury, a stodgy young literature scholar, is studying Myrddin’s papers and is determined to prove her favorite author is a fraud.', 'Fantasy, Young Adult, Romance, Gothic, Mystery, Fiction, Young Adult Fantasy', E'\\', 'A Study in Drowning', '2023-09-19');
INSERT INTO public.book (id, number_of_copies, author, description, genre, image, title, year_of_publication) VALUES (303, 100, ' Matthew McConaughey', 'The debut picture book by Academy Award-winning actor and #1 New York Times bestselling author Matthew McConaughey

Just because I’m in the race,
doesn’t mean I’m fully ready.
Just because I’m shaking,
doesn’t mean that I’m not steady.

Have you ever felt worried and excited at the same time?

Have you ever had your feelings hurt but forgiven someone anyway?

Have you ever thought there was more than one right answer to a question?

That’s because contradictions are all around us. And they make us who we are.

Filled with his trademark humor and wisdom, Academy Award–winning actor and #1 New York Times bestselling author Matthew McConaughey has crafted a soulful and irreverent collection of life lessons that empowers readers, big and small, to celebrate how we are all full of possibility.

Why? Just because.', 'Picture Books, Childrens, Audiobook, Fiction', E'\\', 'Just Because', '2023-09-12');
INSERT INTO public.book (id, number_of_copies, author, description, genre, image, title, year_of_publication) VALUES (304, 200, 'Nonfiction, Self Help, Biography', 'The seven rules to follow to realize your true purpose in life—distilled by Arnold Schwarzenegger from his own journey of ceaseless reinvention and extraordinary achievement, and available for absolutely anyone

The world’s greatest bodybuilder. The world’s highest-paid movie star. The leader of the world’s sixth-largest economy. That these are the same person sounds like the setup to a joke, but this is no joke. This is Arnold Schwarzenegger. And this did not happen by accident.

Arnold’s stratospheric success happened as part of a process. As the result of clear vision, big thinking, hard work, direct communication, resilient problem-solving, open-minded curiosity, and a commitment to giving back. All of it guided by the one lesson Arnold’s father hammered into him above be useful. As Arnold conquered every realm he entered, he kept his father’s adage close to his heart.

Written with his uniquely earnest, blunt, powerful voice, Be Useful takes readers on an inspirational tour through Arnold’s tool kit for a meaningful life. He shows us how to put those tools to work, in service of whatever fulfilling future we can dream up for ourselves. He brings his insights to vivid life with compelling personal stories, life-changing successes and life-threatening failures alike—some of them famous; some told here for the first time ever.

Too many of us struggle to disconnect from our self-pity and connect to our purpose. At an early age, Arnold forged the mental tools to build the ladder out of the poverty and narrow-mindedness of his rural Austrian hometown, tools he used to add rung after rung from there. Now he shares that wisdom with all of us. As he puts it, no one is going to come rescue you—you only have yourself. The good news, it turns out, is that you are all you need.
Genres
Nonfiction
Self Help
Biography', 'Autobiography', E'\\', 'Be Useful: Seven Tools for Life', '2023-10-10');
INSERT INTO public.book (id, number_of_copies, author, description, genre, image, title, year_of_publication) VALUES (406, 121, 'Alice Hoffman', 'From the beloved New York Times bestselling author of The Marriage of Opposites and the Practical Magic series comes an enchanting novel about love, heartbreak, self-discovery, and the enduring magic of books.

One brilliant June day when Mia Jacob can no longer see a way to survive, the power of words saves her. The Scarlet Letter was written almost two hundred years earlier, but it seems to tell the story of Mia’s mother, Ivy, and their life inside the Community—an oppressive cult in western Massachusetts where contact with the outside world is forbidden, and books are considered evil. But how could this be? How could Nathaniel Hawthorne have so perfectly captured the pain and loss that Mia carries inside her?

Through a journey of heartbreak, love, and time, Mia must abandon the rules she was raised with at the Community. As she does, she realizes that reading can transport you to other worlds or bring them to you, and that readers and writers affect one another in mysterious ways. She learns that time is more fluid than she can imagine, and that love is stronger than any chains that bind you.

As a girl Mia fell in love with a book. Now as a young woman she falls in love with a brilliant writer as she makes her way back in time. But what if Nathaniel Hawthorne never wrote The Scarlet Letter ? And what if Mia Jacob never found it on the day she planned to die?

Nathaniel Hawthorne “A single dream is more powerful than a thousand realities.”

This is the story of one woman’s dream. For a little while it came true.', 'Fiction, Historical Fiction, Magical Realism, Fantasy, Books About Books, Time Travel', E'\\', 'The Invisible Hour', '2023-08-15');

